import React, { useEffect, useState } from "react";
import "./App.css";
import User from "./components/User";

const App = () => {
  const [Users, setUsers] = useState([]);
  useEffect(() => {
    fetchUsers();
  }, []);
  const fetchUsers = async (data) => {
    await fetch("https://api.github.com/users")
      .then((res) => res.json())
      .then((data) => setUsers(data))
      .catch((err) => {
        console.log(err);
      });
  };
  return (
    <div>
      <User />
    </div>
  );
};

export default App;
